import React from 'react';

import { fetchWeekForecast } from '../../utils/api';

import '../../styles/components/weather/_city-select.scss';

export default function WeeklyForecast({ forecast }) {

	return (
		<div className="forecast-list">
			<pre>{JSON.stringify(this.props.forecast)}</pre>
		</div>
	)
}
